import { Form, Formik } from 'formik'
import React from 'react'
import FormikInput from './Formik/FormikInput'

const Login = () => {
  
  return (
    <Formik>
      {(formik) => {
        return (
          <Form>
            <FormikInput
              label="Email"
              id="email"
              type="email"
              name="email"
              required={true}
              onChange={(e) => {formik.setFieldValue(e.target.value)}}
            ></FormikInput>
            <br></br>
            <FormikInput
              label="Password"
              id="password"
              type="password"
              name="password"
              required={true}
              onChange={(e) => {formik}}
            ></FormikInput>
          </Form>
        )
      }}

    </Formik>
  )
}

export default Login
